    "desc_para3": { "t": 0, "b": { "t": 2, "i": [{ "t": 3 }], "s": "A fejleszt\xE9s lend\xFClet\xE9hez tudja t\xE1mogatni csapatunkat a GitHub szponor\xE1ci\xF3n kereszt\xFCl. Rem\xE9lj\xFCk elnyeri tetsz\xE9sed\xE9t az Elk!" } },
